        <div>
          <p className="text-3xl font-bold  text-primary ">Growing Together</p>
          <h1 className="font-bold">Grow With Data</h1>
          <div>
            <p className="font-bold">Fast, Flexible and Great</p>
          </div>
        </div>
      </div>
    </>
  );
}

export default Hero;
